  name: 'Visits',
  components: {
    Widget: Widget,
    Map: Map,
    Calendar: Calendar,
    AreaChart: AreaChart,
    AnimatedNumber: AnimatedNumber
  },
  data: function data() {
    return {
      animateNumberOptions: {
        duration: 2000,
        easing: 'easeInQuad',
        formatValue: function formatValue(value) {
          return value.toFixed(0);
        }
      },
      checkedArr: [false, false, false],
      dataCollection: null
    };
  },
  methods: {
    checkTable: function checkTable(id) {
      var arr = [];

      if (id === 0) {
        var val = !this.checkedArr[0];

        for (var i = 0; i < this.checkedArr.length; i += 1) {
          arr[i] = val;
        }
      } else {
        arr = this.checkedArr;
        arr[id] = !arr[id];
      }

      if (arr[0]) {
        var count = 1;

        for (var _i = 1; _i < arr.length; _i += 1) {
          if (arr[_i]) {
            count += 1;
          }
        }

        if (count !== arr.length) {
          arr[0] = !arr[0];
        }
      }

      Vue.set(this, 'checkedArr', arr);
    },
